CREATE DEFINER=`root`@`localhost` PROCEDURE `check_conditions_commission`(IN user_type_id int,IN trans_type_id int,IN transactionalamount double,IN profile_acc_no varchar(19),IN transaction_types_id int,IN transaction_id int)
BEGIN
