set commissionamount = transactionalamount * 0.70;
elseif (user_type_id =3 && trans_type_id = 2) then
set commissionamount = transactionalamount * 0.80;
elseif (user_type_id =3 && trans_type_id = 3) then
set commissionamount = transactionalamount * 0.90;
else
set commissionamount= 0;
end if;
insert into commission values (profile_acc_no,commissionamount,transaction_types_id,commissionamount,transaction_id);
END ;;
