CREATE DEFINER=`root`@`localhost` PROCEDURE `check_daily_limits`(
IN in_accNo varchar(19),
IN in_date1 text,
IN in_date2 text,
IN in_trans_typesId int
)
BEGIN
	DECLARE trans_count int;
    DECLARE trans_count_rule int;
	DECLARE amount_sum double;
    DECLARE amount_sum_rule double;
    
    SET trans_count_rule = (select no_of_transactions_per_day from transaction_rules where trans_types_id = in_trans_typesId );
    SET amount_sum_rule = (select max_value_per_day from transaction_rules where trans_types_id = in_trans_typesId );
	SET trans_count = (SELECT COUNT(*) FROM transactions_all WHERE user_acc_no = in_accNo AND entry = 'credit' AND date BETWEEN in_date1 AND in_date2 AND transaction_types_id = in_trans_typesId);
	
    if(trans_count < trans_count_rule) then
		SET amount_sum = (SELECT SUM(amount) FROM transactions_all WHERE user_acc_no = in_accNo AND entry = 'credit' AND date BETWEEN in_date1 AND in_date2 AND transaction_types_id = in_trans_typesId);
		if(amount_sum < amount_sum_rule) then
			SELECT 1;
		else
			SELECT 0;
        end if;
	else
		SELECT 2;
    end if;
END ;;
DELIMITER ;
