CREATE DEFINER=`root`@`localhost` PROCEDURE `check_monthly_limits`(
IN in_accNo varchar(19),
IN in_date1 text,
IN in_date2 text,
IN in_transTypeId varchar(10)
)
BEGIN
	DECLARE trans_count int;
	DECLARE amount_sum double;
    DECLARE trans_count_from_rule int;
	DECLARE amount_sum_from_rule double;
    
	SET trans_count_from_rule = (select no_of_transactions_per_month from transaction_rules where trans_types_id = in_transTypeId );
	SET trans_count = (SELECT COUNT(*) FROM transactions_all WHERE user_acc_no = in_accNo AND entry = 'credit'  AND status= 'success' AND transaction_types_id =in_transTypeId AND date BETWEEN in_date1 AND in_date2 );
	
    if(trans_count < trans_count_from_rule) then
		SET amount_sum = (SELECT SUM(amount) FROM transactions_all WHERE user_acc_no = in_accNo AND entry = 'credit'  AND status= 'success' AND transaction_types_id = in_transTypeId AND date BETWEEN in_date1 AND in_date2 );
		SET amount_sum_from_rule = (select max_value_per_month from transaction_rules where trans_types_id = in_transTypeId );
        
        if(amount_sum < amount_sum_from_rule OR amount_sum IS NULL) then
			SELECT 1;
		else
			SELECT 0;
        end if;
	else
		SELECT 2;
    end if;  
    
END ;;
