CREATE DEFINER=`root`@`localhost` PROCEDURE `createAccountNumber`(IN profile_type_id INT)
BEGIN
DECLARE random_number,account_number Varchar(19) DEFAULT NULL;
declare ready int default 0;
 DECLARE i, mysum, r, weight,check_digit,k,p,w,z INT;
    DECLARE abc varchar(4);
    
     SET weight = 2;
    SET mysum = 0;
    SET i = 1;
    set check_digit = 0;
    
while not ready do
SELECT FLOOR(RAND() * (9999999-1000000+1)+1000000) INTO random_number;
	if not exists (SELECT number FROM random_numbers where number = random_number) then
            set ready := 1;
	end if;
end while;
INSERT INTO random_numbers VALUES(random_number);
 
 SET @acc = CONCAT('1000000',(select cast(profile_type_id as nchar)), (select cast(random_number as nchar)));
 SET k = length(@acc);
 /*SET @x= luhn_sum(@acc);*/
 
  WHILE i <= k DO
        SET r = substring(@acc, i, 1) * weight;
        if r>9 then 
        SET p=substring(r, 1, 1) +substring(r, 2, 1);
        end if;
        SET mysum = mysum + IF(r > 9, p, r);
        SET i = i + 1;
        if i%2=0 then
        SET weight = 1;
        else
        SET weight = 2;
        end if;
    END WHILE;
    
     SELECT CAST((mysum*9) as nchar(4)) into abc;
     
     /*set check_digit = SELECT RIGHT(abc, 1);*/
   SELECT RIGHT(abc, 1) into check_digit;
 
SET account_number = CONCAT(@acc,check_digit);
 SELECT account_number;
END ;;
DELIMITER ;
