CREATE DEFINER=`root`@`localhost` PROCEDURE `create_trans_id`()
BEGIN
	DECLARE random_number,transactionId Varchar(19) DEFAULT NULL;
	DECLARE ready int default 0;
	DECLARE last_Id text;
	DECLARE i, mysum, r, weight,check_digit,k,p,w,z INT;
    DECLARE abc varchar(4);
    
    SET weight = 2;
    SET mysum = 0;
    SET i = 1;
    set check_digit = 0;
	
    
    while not ready do
		SELECT FLOOR(RAND() * (9999999-1000000+1)+1000000) INTO random_number;
			if not exists (SELECT number FROM random_numbers_transid where number = random_number) then
					set ready := 1;
			end if;
	end while;
    
	INSERT INTO random_numbers_transid VALUES(random_number);
	
    SET last_Id = (SELECT transactions_all.id  FROM transactions_all ORDER BY transactions_all.id DESC LIMIT 0,1);
	SET last_Id = RIGHT(last_Id, 1);
        
	SET @acc = CONCAT('1',(select cast(last_Id as nchar)), (select cast(random_number as nchar)));
	/*SET @x= luhn_sum(@acc);*/
	SET k = length(@acc);
	
	 WHILE i <= k DO
        SET r = substring(@acc, i, 1) * weight;
        if r>9 then 
        SET p=substring(r, 1, 1) +substring(r, 2, 1);
        end if;
        SET mysum = mysum + IF(r > 9, p, r);
        SET i = i + 1;
        if i%2=0 then
        SET weight = 1;
        else
        SET weight = 2;
        end if;
    END WHILE;
	
	SELECT CAST((mysum*9) as nchar(4)) into abc;
     
     /*set check_digit = SELECT RIGHT(abc, 1);*/
   SELECT RIGHT(abc, 1) into check_digit;
	SET transactionId = CONCAT(@acc,check_digit);
     
    SELECT transactionId;
END ;;
