CREATE DEFINER=`root`@`localhost` PROCEDURE `DisplayTableDataByAccno`(
IN in_accno text,
IN in_limitValue int
)
BEGIN
	DECLARE limValue int;
	DECLARE accno text;
	SET limValue = in_limitValue ;
	SET accno = in_accno ;
	SELECT transactions_all.id,transactions_all.t_id,transactions_all.description,transactions_all.date,transactions_all.status,transactions_all.amount,transaction_types.type, 
	GROUP_CONCAT(user_acc_no SEPARATOR ', ') AS account_no , transactions_all.t_id , transactions_all.entry
	FROM transactions_all 
	INNER JOIN transaction_types
	ON transactions_all.transaction_types_id=transaction_types.id  
	WHERE t_id = t_id  
	GROUP BY t_id 
	HAVING account_no LIKE CONCAT('%', accno, '%')
    ORDER BY transactions_all.id desc
	LIMIT limValue,10;
END ;;
