CREATE DEFINER=`root`@`localhost` PROCEDURE `get_creditAccount_details`( IN in_trans_id int )
BEGIN
	declare transaction_type_id int;
	declare transaction_amount double;
SET transaction_type_id = 	
(
select transactions_all.transaction_types_id
from   transactions_all
inner join transaction_types on transaction_types.id = transactions_all.transaction_types_id
inner join fee_category_rules on fee_category_rules.transaction_types_id = transactions_all.transaction_types_id
where  transactions_all.entry = "credit" AND transactions_all.status="success" AND in_trans_id = transactions_all.t_id
);
 
if ( transaction_type_id = 1 or transaction_type_id = 5 or transaction_type_id = 7  ) then
	select  0;
    end if;   
if (transaction_type_id = 4) then
	select  1;
    end if;   
if ( transaction_type_id = 2 or transaction_type_id = 3 ) then
    set transaction_amount =
		(
		select transactions_all.amount
		from   transactions_all
		inner join transaction_types on transaction_types.id = transactions_all.transaction_types_id
		inner join fee_category_rules on fee_category_rules.transaction_types_id = transactions_all.transaction_types_id
		where  transactions_all.entry = "credit" AND transactions_all.status="success" AND in_trans_id = transactions_all.t_id
		);
        if (transaction_amount between 0 and 5000 ) then
			select 2;
		elseif ( transaction_amount between 5000 and 50000 ) then
			select 3;
		elseif ( transaction_amount between 50000 and 100000 ) then
			select 3;
		else
			select 4;
		end if;
end if;   
END ;;
