CREATE DEFINER=`root`@`localhost` PROCEDURE `get_fees_rules`(
in in_trans_type_id int,
 in in_amount double
)
BEGIN
declare fee_val double;
declare fee_rate_val double;
set fee_val = (SELECT fee from fee_category_rules
where in_trans_type_id = fee_category_rules.transaction_types_id AND in_amount between fee_category_rules.min_amount and fee_category_rules.max_amount 
);
set fee_rate_val = (SELECT fee from fee_category_rules
where in_trans_type_id = fee_category_rules.transaction_types_id AND in_amount between fee_category_rules.min_amount and fee_category_rules.max_amount );
if (fee_val) then
select concat("0",fee_val);
else
select concat("1",fee_rate_val);
end if;
END ;;
