CREATE DEFINER=`root`@`localhost` PROCEDURE `search`(
IN in_date1 VARCHAR(20),
IN in_date2 VARCHAR(20),
IN in_accno VARCHAR(20),
IN in_status VARCHAR(10),
IN in_type VARCHAR(10),
IN in_amountmin VARCHAR(10),
IN in_amountmax VARCHAR(10)
)
BEGIN
	SELECT
		tran.id, tran.t_id, tran.transaction_types_id, tran.entry, tran.date, tran.amount, tran.description,tran.status, GROUP_CONCAT(user_acc_no SEPARATOR ', ') AS user_acc_no , tran.balance_amount, tran.merchant_category_code
	FROM transactions_all tran
    WHERE ( (in_date1='' and in_date2='') XOR tran.date BETWEEN in_date1 and in_date2 )
    AND (in_accno= '' XOR find_in_set(tran.user_acc_no,in_accno))
    AND (in_status='' XOR find_in_set(tran.status, in_status))
    AND (in_type='' XOR find_in_set(tran.transaction_types_id, in_type))
    AND((in_amountmin='' and in_amountmax='') XOR tran.amount BETWEEN in_amountmin and in_amountmax )
    GROUP BY t_id;
END ;;
