CREATE DEFINER=`root`@`localhost` PROCEDURE `update_Wallet`(
IN in_accNo varchar(19),
IN in_amount double,
IN in_entry varchar(100)
)
BEGIN
	DECLARE balance_before double;
    DECLARE balance_after double;
    DECLARE balance_updated double;
    
	SET balance_before = (SELECT CAST(FROM_BASE64(w.amount) AS CHAR) FROM wallet w WHERE w.acc_no = in_accNo);
	
    
    if(in_entry like 'credit') then
		SET balance_after = (balance_before - in_amount);
	end if;
	
    if(in_entry like 'debit') then
		SET balance_after = (balance_before + in_amount);
    end if;
    
    
    UPDATE wallet 
		SET amount = TO_BASE64(balance_after)
        WHERE acc_no = in_accNo;
   SET balance_updated = (SELECT CAST(FROM_BASE64(w.amount) AS CHAR) FROM wallet w WHERE w.acc_no = in_accNo);
	
    if(balance_updated like balance_after) then
		SELECT 1;
    else
		SELECT 0;
    end if;
END ;;
